import React from 'react'

const Menu = () => (
  <>
    <p><a href="#home">Home</a></p>
    <p><a href="#wgpt3">What is GPT3?</a></p>
    <p><a href="#possibility">Open aI</a></p>
    <p><a href="#features">Case Sstudies</a></p>
    <p><a href="#blog">Library</a></p>
  </>
)


const Content = () => {
  return (
    <div tag='home'>
      <h1>Experience</h1>
    </div>
  )
}

export default Content
